INSERT INTO `exercicioflexibilidade` (`id`,`nome`,`tipomembro`,`descricao`) VALUES 
 (1,'\"Exerccio 1\"',1,'\"Alongamento para panturilha. Apoia-se na parede, estenda a perna de trs sentindo alongar o gastrocnmio. Aps faa com a outra perna..\"'),
 (2,'\"Exerccio 2\"',1,'\"Alongamento para panturrilha. Apoia-se na parede, flexione a perna de trs abaixando o quadril. Aps faa com a outra perna.\"'),
 (3,'\"Exerccio 3\"',1,'\"Alongamento do glteo. Deitado, flexione a perna encostando no peito, outra perna estendida no cho. Aps faa com a outra perna.\"'),
 (4,'\"Exerccio 4\"',1,'\"Alongamento do quadril. Agachado, com um joelho apoiado no cho estenda o mximo o quadril, aps faa com a outra perna.\"'),
 (5,'\"Exerccio 5\"',1,'\"Alongamento do quadril. Agachado estenda o mximo a perna traseira. Aps faa com a outra perna.\"'),
 (6,'\"Exerccio 6\"',1,'\"Alongamento do quadril. Apoia-se com um dos ps em um apoio projetando o quadril para frente. Aps faa com a outra perna.\"'),
 (7,'\"Exerccio 7\"',1,'\"Alongamento da coxa. Agachado apoie o joelho da perna traseira no cho, com a mo oposta segure a ponta do p e aprxime dos glteos. Aps faa com a outra perna.\"'),
 (8,'\"Exerccio 8\"',1,'\"Alongamento da coxa. Deitado coloque uma toalha na ponta de um dos ps, estenda a perna para cima. Aps faa com a outra perna.\"'),
 (9,'\"Exerccio 9\"',1,'\"Alongamento da coxa. Estenda a perna em um apoio na altura do quadril, aproximando o tronco da perna. Aps faa com a outra perna.\"'),
 (10,'\"Exerccio 10\"',1,'\"Alongamento da coxa. Sentado com as pernas afastadas e estendidas, segure um dos ps aproximando o tronco na perna. Aps faa com a outra perna.\"'),
 (11,'\"Exerccio11\"',1,'\"Alongamento da coxa. Sentado, encoste uma palma do p na outra, afastando os joelhos ao mximo.\"'),
 (12,'\"Exerccio 12\"',1,'\"Alongamento da coxa. Sentado, afaste ao mximo as pernas, inclinando um pouco o tronco para frente.\"'),
 (13,'\"Exerccio 13\"',1,'\"Alongamento das pernas. Sentado e com as pernas bem estedidas, prenda uma toalha nos ps e puxe em direo ao corpo.\"'),
 (14,'\"Exerccio 14\"',1,'\"Alongamento do glteo. Deitado em posio dorsal, flexione uma das pernas cruzando a outra que st estendida. Aps faa com a outra perna.\"'),
 (15,'\"Exerccio 15\"',1,'\"Alongamento de coxa e gltro. Deitado em posio dorsal, fexione o quadril e joelho de uma das pernas. Segure a ponta do p aproximando em direo ao peito. Aps faa com a outra perna.\"'),
 (16,'\"Exerccio 16\"',1,'\"Alongamento de gleos e lombar. Deitado abrace os joelhos aproximando bem do peito.\"'),
 (17,'\"Exerccio 17\"',1,'\"Alongamento da lombar. Sentado e levemente flexionado as pernas, segure a ponta dos ps aproximando o mximo o trono dos ps.\"'),
 (18,'\"Exerccio 18\"',1,'\"Alongamento da coxa. Em p apoiado na parede, deixe o quadril de descolcar lateralente para um dos lados at o mximo possvel. Repita no outro lado.\"'),
 (19,'\"Exercicio 19\"',1,'\"Alongamento da coxa. Em p escore a ponta do p em um apoio a suas costa. Estenda o quadril para baixo. Aps faa com a outra perna.\"'),
 (20,'\"Exerccio 20\"',1,'\"Alongamento das coxas. Em p e flexionando o quadril, solte o peso do corpo para baixo.\"'),
 (21,'\"Exerccio 21\"',2,'\"Alongamento de braos e costas. De joelhos e as palmas das mos no cho,  estenda os braos o mais distante possvel.\"'),
 (22,'\"Exerccio 22\"',2,'\"Alongamento doo brao. Em p, segure o cotovelo aproximando-o ao ombro do lado oposto. Aps, faa com o outro brao.\"'),
 (23,'\"Exerccio 23\"',2,'\"Alongamento dos braos e costas. Em uma barra, se pendure e deixa o peso do corpo agir para baixo.\"'),
 (24,'\"Exerccio 24\"',2,'\"Alongamento de braos e peito. Em p apoie a palma da mo em uma abertura de porta, fazendo com que os braos estendidos vo para atrs do corpo.\"'),
 (25,'\"Exerccio 25\"',2,'\"Alongamento de brao e peito. Em p com o brao estendido e apoiado em uma superfcie plana, estender o mximo atrs das costas, alinhado com o ombro. Aps, faa com o outro brao.\"'),
 (26,'\"Exerccio 26\"',2,'\"Alongamento de peito e ombro. Em p, um ajudante segura as mos realizando uma hiperextenso horizontal dos ombros, cruzando os punhos, at seu limite.\"'),
 (27,'\"Exerccio 27\"',2,'\"Alongamento para as costas e braos. Em p, apoie-se em uma barra, flexioando o quadril em direo ao solo.\"'),
 (28,'\"Exerccio 28\"',2,'\"Alongamento para o brao. Em p, segurando um dos cotovelos, estenda o mximo possvel colocando o cotovelo atrs da cabea.\"'),
 (29,'\"Exerccio 29\"',2,'\"Alongamento para braos e antebao. Em quatro apoios, ponta dos dedos invertida, faa uma extenso dos dedos com a ajuda do corpo, este se delocando para trs.\"'),
 (30,'\"Exerccio 30\"',2,'\"Alongamento para ombro e pescoo. Em p, puxe um brao por trs do corpo, inclinando a cabea para o mesmo sentido.Aps, faa com o outro brao.\"'),
 (31,'\"Exerccio 31\"',2,'\"Alongamento para o pescoo. Em p, lentamente, faa movimentos de rotao da cabea. Estendendo o pescoo para um lado e para outro, para frente e para trs.\"');
INSERT INTO `exerciciomusculacao` (`id`,`grupomuscular`,`descricao`,`nome`) VALUES 
 (72,6,'\"Segurando manopolas em polias altas, deve-se inclinar o tronco a frente, aproximando as mos a frente e \"\"colado\"\" do abdomem.\"','\"Cross-over\"'),
 (73,6,'\"Deitado em um banco segurando um par de halteres, deve-se estender os braos abaixo da linha do banco, vagarosamente eleva-se os braos estendidos aproximando os halteres no alto(na altura do mamilo).\"','\"Crucifixo\"'),
 (74,6,'\"Ficando pendurado nas paralelas, deve-se estender os braos por completo, deixando o corpo descer vagarosamente at a altura do peito.\"','\"Paralelas\"'),
 (75,6,'\"Com apoio nas costas de um banco, segura-se um halteres. Brao estendido acima da cabea. Trazer o halteres com o brao estendido na altura do mamilo.\"','\"Pull-over com halteres\"'),
 (76,6,'\"Os polegares devem estar por fora, e a pega da barra depende  essencialmente do tipo de supino pretendido, fechado, normal ou largo.  Faz-se descer suavemente a barra at ao nvel do peito (encostando a barra ao peito, na parte superior/clavicular). Mantendo as costas encostadas ao banco, e os ps firmemente \"\"colados\"\"   ao solo, empura-se controladamente a barra at se aproximar da extenso total dos braos, e novamente repetir o movimento de descida. Deve-se inspirar no movimento descida, e expirar no movi\"','\"Supino inclinado\"'),
 (77,6,'\"Os polegares devem estar por fora, e a pega da barra depende  essencialmente do tipo de supino pretendido, fechado, normal ou largo.  Faz-se descer suavemente a barra at ao nvel do peito (encostando a barra ao peito, a meio da zona entre o pescoco e mamilo).   Mantendo as costas encostadas ao banco, e os ps firmemente \"\"colados\"\"   ao solo, empura-se controladamente a barra at se aproximar da extenso total dos braos, e novamente repetir o movimento de descida. Deve-se inspirar no movimento descida, e ex\"','\"Supino reto\"'),
 (78,6,'\"No aparelho especfico, alinhe os cotovelos na altura dos ombros, aproxime-os vagarosamente, retornando da mesma forma.\"','\"Voador\"'),
 (79,5,'\"Segure uma barra com uma pegada com as palmas das mos para frente, com as mos um pouco mais abertas do que a largura dos ombros. Segure a barra na altura dos ombros. Lentamente levante at que os cotovelos se estendam completamente.\"','\"Desenvolvimento com barra\"'),
 (80,5,'\"Segure os halteres com uma pegada com as palmas das mos para frente, com as mos um pouco mais abertas do que a largura dos ombros. Segure os halteres na altura dos ombros. Lentamente levante at que os cotovelos se estendam completamente acima da cabea.\"','\"Desenvolvimento com halteres\"'),
 (81,5,'\"Levante a barra pela frente at os braos estarem num ngulo de 90 graus em relao ao corpo ou ligeiramente mais altos. Usnado halteres, realizar o movimento dos braos alternados.\"','\"Elevaes frontais dos ombros\"'),
 (82,5,'\"Levante os pesos para os lados at os braos estarem num ngulo de 90 graus em relao ao corpo ou ligeiramente mais altos.\"','\"Elevaes laterais dos ombros\"'),
 (83,3,'\"Segure um haltere em cada mo com uma pegada neutra (de modos que as palmas das mos apontem uma para a outra). Flexione os cotovelos trazendo os halteres em direo aos ombros. Para total envolvimento dos bceps supine suas mos enquanto os halteres so levantados, gire as mos gradualmente de forma que as palmas estejam voltadas para trs no final do movimento.\"','\"Rosca bceps alternada\"'),
 (84,3,'\"Segure uma barra, onde suas mos estaro supinadas e braos levemente afastados da linha dos ombros. Flexione os cotovelos trazendo os halteres em direo aos ombros.\"','\"Rosca bceps direta\"'),
 (85,3,'\"Num banco inclinado segure uma barra, onde suas mos estaro supinadas e braos levemente afastados da linha dos ombros. Flexione os cotovelos trazendo os halteres em direo aos ombros.\"','\"Rosca bceps scott\"'),
 (86,3,'\"Segure uma barra, onde suas mos estaro pronadas e braos levemente afastados da linha dos ombros. Flexione os cotovelos trazendo os halteres em direo aos ombros.\"','\"Rosca bceps inversa\"'),
 (87,4,'\"Pernas semiflexionadas, tronco paralelo ao cho. Braos estendidos segurando halteres. Realizar uma extenso horizontal dos braos, aastando o mximo os halteres.\"','\"Voador invertido\"'),
 (88,4,'\"Assuma uma posio sentado ou ajoelhado numa polia alta, dependendo do modelo. Segure a barra prximo s extremidades de modos que os braos formem um \"\"V\"\". Relaxe os braos numa posio totalmente estendida, com o tronco e cintura retos e em linha com os braos. Puxe para baixo numa velocidade moderada, concentrando-se em trazer os cotovelos para baixo. Ocorrer flexo nos cotovelos mas  uma conseqncia da aduo, isto , passiva. Traga a barra at a frente do queixo(frontal) ou at que toque a parte de t\"','\"Puxada frontal/dorsal\"'),
 (89,4,'\"Segurando uma barra flexione os cotovelos trazendo-la na altura do queixo sempre prximo do corpo.\"','\"Remada elevada\"'),
 (90,4,'\"Segurando a barra e estando com o corpo inclinado  frente, aproxime ela encostando no abdomem vagarosamente. Retorne lentamente estendendo os braos.\"','\"Remada curvada com barra\"'),
 (91,4,'\"Sentado e com as pernas semiflexionadas, segure a manopla pressa na polia baixa do aparellho. Deixe os braos estendios, em seguida flexione trazendo suas mos para junto de seu corpo na altura do abdomem.\"','\"Remada sentada no puxador\"'),
 (92,4,'\"Segurando a barra na polia alta com os braos estendidos, deve-se aproximar da linha do quadril. Retornando vagarosamente at a altura dos ombros.\"','\"Pull-down\"'),
 (93,7,'\"Ps firmemente no cho e barra apoiadas na parte posterior da cabea e nos ombros. Empurrar at a extenso completa. No movimento descendente, parte excntrica, parar quando o joelho estiver em um ngulo de 90 graus, no  necessrio flexionar o joelho mais do que 90 graus.\"','\"Agachamento com barra\"'),
 (94,7,'\"Ps firmemente na plataforma do aparelho e empurrar at a extenso completa. No movimento descendente, parte excntrica, parar quando o joelho estiver em um ngulo de 90 graus, no  necessrio flexionar o joelho mais do que 90 graus.\"','\"Agachamento Pack\"'),
 (95,7,'\"Estenda as pernas at a total extenso, flexione at um ngulo de 90 graus.\"','\"Extenso de joelhos\"'),
 (96,7,'\"Flexione os joelhos at que estejam num ngulo de 90 graus.\"','\"Flexo de joelhos\"'),
 (97,7,'\"Ps firmemente na plataforma do aparelho inclinado e empurrar at a extenso completa. No movimento descendente, parte excntrica, parar quando o joelho estiver em um ngulo de 90 graus, no  necessrio flexionar o joelho mais do que 90 graus.\"','\"Leg-press inclinado\"'),
 (98,7,'\"O posicionamento dos calcanhares, pode ser, paralelo a coxa, desviado  para dentro ou para fora, consoante a zona do msculo (mdio, interior ou exterior) que se pretende trabalhar.  A mquina deve ser previamente ajustada de modo a que o peso seja todo  ele erguido no movimento de ascenso do exerccio.  Erguendo os calcanhares, deve-se cuidadosamente destravar a maquina (esta deve ser destravada e travada sempre em posio alta). Partindo da posio alta, com o suporte bem assentadonos ombros,  costas direitas, e com os joelhos bloqueados  deve-se  iniciar o movimento de descida dos calcanhares at que os msculos estejam totalmente alongado.  Sem sobressaltos, deve-se lentamente levantar os calcanhares, apoiando e empurrando a extremidade dos ps sobre o seu suporte, at a total  extenso dos joelhos.\"','\"Panturriha elevao em p\"'),
 (99,7,'\"O posicionamento dos calcanhares, pode ser, paralelo a coxa, desviado  para dentro ou para fora, consoante a zona do msculo (mdio, interior ou exterior) que se pretende trabalhar. Erguendo os calcanhares, deve-se cuidadosamente destravar a mquina (esta deve ser destravada e travada sempre em posio alta). Partindo da posio alta, com o suporte bem assentado nas pernas e costas direitas deve-se  iniciar o movimento de descida dos calcanhares at que os msculos estejam totalmente alongado.  Sem sobressaltos, deve-se lentamente levantar os calcanhares, apoiando e empurrando a extremidade dos ps sobre o seu suporte, at a total  extenso dos joelhos.\"','\"Panturrilha - levao sentado\"'),
 (100,7,'\"Em p com pernas semiflexionadas esttica, flexione o quadril levando a barra at o cho, retornado com a barra at a altura do quadril.\"','\"Terra stiff\"'),
 (101,8,'\"Sentado em um banco com coluna alinhada. Braos estendidos acima da cabea segurando uma barra. Deve-se deixar descer a barra lentamente atrs de sua cabea, retornando vagarosamente at a completa extenso dos braos acima da cabea.\"','\"Trceps com barra\"'),
 (102,8,'\"Deitando num banco de supino, com os braos flexionados encostando a barra na testa. Estender por completo o brao, retornando lentamente ao ponto de partida.\"','\"Trceps na testa\"'),
 (103,8,'\"Em p com o corpo levemente inclinado para frente, brao colado ao corpo e antebrao num ngulo de 90 graus, pegada em pronao. Estender o antebrao at encostar nas pernas, retornando lentamente ao ponto inicial.\"','\"Trceps roldana\"'),
 (104,8,'\"Em p com o corpo levemente inclinado para frente, brao unilateralmente colado ao corpo e antebrao num ngulo de 90 graus, pegada em supinao. Estender o antebrao at encostar nas pernas, retornando lentamente ao ponto inicial.\"','\"Trces unilateral pulley\"'),
 (105,2,'\"Segurando uma barra com punhos em pronao. Os antebraos devem estar apoiados nas pernas, deixar rolar a barra flexionando o mximo os punhos, no retorno estenda todo o punho.\"','\"Rosca punho pronada\"'),
 (106,2,'\"Segurando uma barra com punhos em supinao. Os antebraos devem estar apoiados nas pernas, deixar rolar a barra estendendo o mximo os punhos, no retorno  flexione todo o punho.\"','\"Rosca punho supinada\"'),
 (107,1,'\"No aparelho devemos flexionar o abdomem se aproximando dos joelhos, realizar a fora concentrada no abdomem e no nos braos.\"','\"Abdominal mquina\"'),
 (108,1,'\"Deitado sobre as costas, joelhos semiflexionados/flexionadas (com pernas levantadas ou no)  e mos sobre a cabea (cruzadas ou no sobre a nuca, ou sobre as temporas).   Nesta posio, deve-se encostar a coluna lombar ao solo (ou banco) e   inspirar. Expirando lentamente e potentemente, deve flexionar a coluna  lombar, conduzindo o osso do esterno, na direo do pbis (sem descolar  do solo ou banco, a parte inferior das costas) e o quadril em drieo a cabea. Marca-se um tempo de paragem em posicao alta, encolhendo a barriga voluntariamente (trabalho  dos transversais), com o intuito de procurar uma contrao mxima.  Deve-se ento de seguida retomar o regresso ao solo ou banco, inspirando e controlando totalmente o movimento.\"','\"Crunches\"'),
 (109,1,'\"Apoiado em paralelas ou em aparelho semelhante, deve-se flexionar o quadril trazendo os joelhos na altura do umbigo, excntricamente deve-se estender at 45 graus do quadril.\"','\"Abdominal nas paralelas\"'),
 (110,1,'\"Completamente deitado sobre as costas, com pernas estendidas E joelhos  ligeiramente fletidos, o executante inspira, para depois, expirando, levar as pernas  posio vertical, sempre com a preocupao de no desencostar,  a coluna lombar do solo (ou banco). Na continuidade do movimento, faz-se  descer as pernas (no sentido oposto). Logo que a coluna lombar descole  do suporte (solo ou banco), deve-se elevar as pernas, sem interrupo e brusquido no movimento, e sobretudo sem balano, recorrendo nica e   exclusivamente ao grupo de msculos abdominais. De seguida, executa-se o processo de regresso ao solo (ou banco), inspirando, controlando e conduzindo todo o movimento.\"','\"Elevao das pernas na prancha\"'),
 (111,1,'\"Com uma barra apoiada aos ombros atrs da cabea, deve realizer rotaes laterais lentamente, concentrando a fora na regio abdominal.\"','\"Rotao do tronco\"');
